import React from "react";
import { Row, Col } from "antd";
import CustomizedFilterPanelTable from 'src\view\components\data-display\table\customizedFilterPanel.jsx';


function maquinas() {
    return (
        <Row gutter={[32, 32]}>
      <Col span={24}>
        <PageContent
          title="Maquinas"
          breadcrumb={[
            {
              title: "Pages",
            },
            {
              title: "Maquinas",
            }
          ]}
        />
      </Col>
    </Row>
        //<><CustomizedFilterPanelTable /></>
    );
}

export default maquinas;
